import React from 'react';
import {
    HashRouter,
    Route,
    Switch,
    Redirect    
} from 'react-router-dom';

import Layout from './Layout/Layout';


const App = () => {
    
    return (
        <HashRouter>
            <Switch>
                <Route path="/" exact  component={() => <Redirect to="/app/dashboard" /> } />
                <Route path="/app" exact component={() => <Redirect to="/app/dashboard" /> } />
                <Rout path="/app/dashboard" component={Layout} />
            </Switch>
        </HashRouter>
    )

}


export default App;
